graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Item" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Item</b> <i>&lt;type&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="id__key" align="left" balign="left">id : string</td><td port="id__value" align="left" balign="left">null</td></tr><tr><td port="value__key" align="left" balign="left">value : number</td><td port="value__value" align="left" balign="left">null</td></tr></table></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000", URL="#L1:0-4:1"];
  "processor" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>processor</b> <i>&lt;task&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="items__key" align="left" balign="left">items : Array&lt;Item&gt;</td><td port="items__value" align="left" balign="left">[<BR/>  {<BR/>    &quot;id&quot;: 1,<BR/>    &quot;value&quot;: 100<BR/>  },<BR/>  {<BR/>    &quot;id&quot;: 2,<BR/>    &quot;value&quot;: 200<BR/>  }<BR/>]</td></tr><tr><td port="itemMap__key" align="left" balign="left">itemMap : Map&lt;string, Item&gt;</td><td port="itemMap__value" align="left" balign="left">#itemRegistry</td></tr><tr><td port="pendingItem__key" align="left" balign="left">pendingItem : Promise&lt;Item&gt;</td><td port="pendingItem__value" align="left" balign="left">#asyncFetch</td></tr></table></td></tr></table>>, pad=0.5, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", URL="#L6:0-15:1"];

}
